sub new {
    my $that  = shift;
    my $class = ref( $that ) || $that;
    my $self;

    $self->{CHARGES} = GetCHARGES();   ## charges of residues

    while( scalar( @_ )) {
        $self->{uc( $_[0] )} = $_[1];
        shift, shift;
    }
    return bless  $self, $class;
}

sub Charges { my $self = shift; if (@_) { $self->{CHARGES} = shift } return $self->{CHARGES}; }

